import styled from "styled-components";

export const Wrapper = styled.main`
  min-height: 100vh;
  padding: 60px 30px;
`;

export const CopySection = styled.section`
  margin: 60px 0 60px;
`;

export const ContactNavigation = styled.nav`
  margin: 60px 0;
`;

export const List = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
`;
